import {REMOVE_PRODUCT} from '../actions/types'

export const clearProduct = (name) => {
    return(dispatch) => {
        console.log("Inside clear product." + name)
        dispatch({
            type:REMOVE_PRODUCT,
            name: name
        })
    }
}
